    [],nt"revision_timestamp": "2016-02-01T17:26:44.154813",nt"name": "army-military-land-tracts-amlt",nt"isopen":
    false,nt"url": null,nt"notes": "This data set is part of a collection of
    real estate data concerning current and historic military installations whose real
    property interests are managed by the U.S. Army Corps of Engineers. This data set
    covers installations within the United States, including Alaska and Hawaii, and
    installations in territories of the United States. Source data used to produce it
    includes paper charts and maps, legacy data from the Real Estate Management Information
    System (REMIS) and legal descriptions. Methods used include coordinate geometry
    entry (COGO) from legal descriptions, coincident features, scanned drawings, aerial
    imagery and other parcel data. Details pertaining to the sources methods and accuracy
    of specific features can be found in the feature level metadata associated with
    the individual features.",nt"license_title": null,nt"extras": [{ntt"key":
